import './App.css';
import ColorGradient from "./components/ColorGradient"

function App() {
  return (
    <div className="App">
    var canvas = document.getElementById("myCanvas");
    var ctx = canvas.getContext("2d");
    ctx.beginPath();
    ctx.arc(95,50,40,0,2*Math.PI);
    ctx.stroke();
      <ColorGradient />
    </div>
  );
}

export default App;
